import React, { useState, useEffect } from "react";
import Navigation from '../components/Navigation';
import Réseaux from '../components/Réseaux';
import TexteAccueil from '../components/TexteAccueil';
import Scroll from '../components/Scroll';
import Logo from '../components/Logo';
import Décompte from '../components/Décompte';
//import "../style/pages/_accueil.scss";

const Accueil = () => {
    
    const [dateData,setData]=useState([]);
    const url = "http://localhost:3000/date";

    useEffect(() => {
      fetch(url)
        .then((response) => response.json())
        .then((data) => {
          setData(data);
        });
    }, []);

    const getData=()=>{
      fetch('date.json'
      ,{
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
      }
      )
        .then(function(response){
          console.log(response)
          return response.json();
        })
        .then(function(date) {
          console.log(date);
          setData(date)
        });
    }
    return (
    <div>
        <div className="home">
            <Navigation/>
            <Logo/> 
            <Réseaux/>
            <div className="home-main">
                <div className="main-content">
                    <h1> ECE POKER </h1>
                    <h2><TexteAccueil/></h2>
                </div>
            </div>
            <Décompte date={"12/23/2021"}/>
            <Scroll right={"/presentation"} />
        </div>
    </div>
    );
};

export default Accueil;
